<div class="text-container"><span class="t s10" style="left:69px;bottom:1098px;letter-spacing:-0.01px;">c) La réalisation ou le recours à un audit énergétique </span>
<span class="t s1" style="left:69px;bottom:1065px;letter-spacing:-0.01px;">La réalisation ou le recours à un audit énergétique conforme aux exigences de l'article 8 de l'arrêté du 17 novembre </span>
<span class="t s1" style="left:69px;bottom:1047px;letter-spacing:-0.01px;">2020, répondant aux conditions relatives aux caractéristiques techniques et modalités de réalisation de travaux et </span>
<span class="t s1" style="left:69px;bottom:1029px;letter-spacing:-0.01px;">prestations dont les dépenses sont éligibles à la prime de transition énergétique. Cet audit énergétique est réalisé </span>
<span class="t s1" style="left:69px;bottom:1011px;letter-spacing:-0.01px;">par un auditeur dont les conditions de qualification sont précisées par le </span><span class="t s10" style="left:546px;bottom:1011px;letter-spacing:-0.01px;">décret n° 2018-416 du 30 mai 2018 </span>
<span class="t s1" style="left:69px;bottom:992px;letter-spacing:-0.01px;">.L'accompagnateur agréé peut sans préjudice de l'audit mentionné au précédent alinéa avoir recours à un audit </span>
<span class="t s1" style="left:69px;bottom:974px;letter-spacing:-0.01px;">existant répondant aux conditions de l'arrêté du 4 mai 2022 définissant pour la France métropolitaine le contenu de </span>
<span class="t s1" style="left:69px;bottom:956px;letter-spacing:-0.01px;">l'audit énergétique réglementaire prévu par </span><span class="t s10" style="left:356px;bottom:956px;letter-spacing:-0.01px;">l'article L. 126-28-1 du code de la construction et de l'habitation</span><span class="t s1" style="left:773px;bottom:956px;letter-spacing:-0.01px;">, réalisé </span>
<span class="t s1" style="left:69px;bottom:938px;letter-spacing:-0.01px;">par un auditeur dont les conditions de qualification sont précisées par le </span><span class="t s10" style="left:546px;bottom:938px;letter-spacing:-0.01px;">décret n° 2022-780 du 4 mai 2022. </span>
<span class="t s1" style="left:69px;bottom:920px;letter-spacing:-0.01px;">Conformément à l’arrêté du 14 décembre 2023 modifiant l'arrêté du 21 décembre 2022 relatif à la mission </span>
<span class="t s1" style="left:69px;bottom:901px;letter-spacing:-0.01px;">d'accompagnement du service public, l’accompagnateur rénov pourra sous-traiter la réalisation de l’audit </span>
<span class="t s1" style="left:69px;bottom:883px;letter-spacing:-0.01px;">énergétique a un diagnostiqueur immobilier titulaire de la certification DPE sans mention. </span>
<span class="t s1" style="left:69px;bottom:850px;letter-spacing:-0.01px;">L'évaluation énergétique comportera à minima deux scénarios de rénovation, permettant d'atteindre en une ou </span>
<span class="t s1" style="left:69px;bottom:832px;letter-spacing:-0.01px;">plusieurs étapes un niveau de performance énergétique optimal pour le logement considéré, en fonction de </span>
<span class="t s1" style="left:69px;bottom:814px;letter-spacing:-0.01px;">l'évaluation des gisements d'économies d'énergie et du temps de retour sur investissement propre à chacun des </span>
<span class="t s1" style="left:69px;bottom:796px;letter-spacing:-0.01px;">gestes de rénovation visés. </span>
<span class="t s1" style="left:69px;bottom:768px;letter-spacing:-0.01px;">Pour chaque étape des scénarios de travaux, l'évaluation énergétique précisera : </span>
<span class="t s12" style="left:115px;bottom:737px;">✓</span><span class="t s1" style="left:127px;bottom:737px;letter-spacing:-0.01px;">L’état des lieux </span>
<span class="t s12" style="left:115px;bottom:714px;">✓ </span><span class="t s1" style="left:131px;bottom:714px;letter-spacing:-0.01px;">L’évaluation de la consommation annuelle d'énergie finale et primaire, les émissions de gaz à effet de serre </span>
<span class="t s1" style="left:115px;bottom:695px;letter-spacing:-0.01px;">du bâtiment avant et après travaux pour chaque usage suivant de l'énergie : le refroidissement, la production </span>
<span class="t s1" style="left:115px;bottom:677px;letter-spacing:-0.01px;">d'eau chaude sanitaire, la ventilation et l'éclairage, et autres apports internes </span>
<span class="t s12" style="left:115px;bottom:655px;">✓</span><span class="t s1" style="left:127px;bottom:655px;letter-spacing:-0.01px;">La part du chauffage </span>
<span class="t s12" style="left:115px;bottom:632px;">✓</span><span class="t s1" style="left:127px;bottom:632px;letter-spacing:-0.01px;">L’estimation des économies d'énergie en kWh, puis en euros par rapport à la situation initiale </span>
<span class="t s12" style="left:115px;bottom:609px;">✓</span><span class="t s1" style="left:127px;bottom:609px;letter-spacing:-0.01px;">L’estimation du coût des travaux détaillés par action et les aides financières correspondantes </span>
<span class="t s12" style="left:115px;bottom:586px;">✓</span><span class="t s1" style="left:127px;bottom:586px;letter-spacing:-0.01px;">L’évaluation qualitative du confort thermique par une évaluation de la qualité de l'enveloppe en termes de </span>
<span class="t s1" style="left:115px;bottom:567px;letter-spacing:-0.01px;">protection solaire, de taux de renouvellement d'air et de l'impact des apports internes </span>
<span class="t s12" style="left:115px;bottom:545px;">✓</span><span class="t s1" style="left:127px;bottom:545px;letter-spacing:-0.01px;">Pour chaque type de travaux proposés, les critères de performances minimales des équipements, </span>
<span class="t s1" style="left:115px;bottom:526px;letter-spacing:-0.01px;">matériaux ou appareils nécessaires aux entreprises pour la réalisation des travaux </span>
<span class="t s12" style="left:115px;bottom:504px;">✓</span><span class="t s1" style="left:127px;bottom:504px;letter-spacing:-0.01px;">La liste des aides publiques correspondantes aux travaux qui seront réalisés </span>
<span class="t s10" style="left:69px;bottom:478px;letter-spacing:-0.01px;">d) Cas des collectivités régies par l'article 73 de la Constitution : </span>
<span class="t s12" style="left:115px;bottom:449px;">✓</span><span class="t s1" style="left:127px;bottom:449px;letter-spacing:-0.01px;">Non concerné </span>
<span class="t s10" style="left:69px;bottom:423px;letter-spacing:-0.01px;">e) Un examen de l'état du logement réalisé sur site, comprenant : </span>
<span class="t s1" style="left:69px;bottom:396px;letter-spacing:-0.01px;">1° Une évaluation de la situation d'indignité, d'indécence et de péril du logement avec l'appui d'une grille d'analyse </span>
<span class="t s1" style="left:69px;bottom:378px;letter-spacing:-0.01px;">simplifiée communiquée par l'Agence nationale de l'habitat. En cas de situation manifeste d'habitat indigne, </span>
<span class="t s1" style="left:69px;bottom:360px;letter-spacing:-0.01px;">d'indécence, l'accompagnateur agréé saisira le pôle départemental de l'habitat compétent et les autorités régionales </span>
<span class="t s1" style="left:69px;bottom:341px;letter-spacing:-0.01px;">de santé </span>
<span class="t s1" style="left:69px;bottom:323px;letter-spacing:-0.01px;">2° Une évaluation simplifiée de la perte d'autonomie du ménage avec l'appui d'une grille d'analyse simplifiée </span>
<span class="t s1" style="left:69px;bottom:305px;letter-spacing:-0.01px;">communiquée par l'Agence nationale de l'habitat. En cas de situation manifeste de non-adaptation à une perte </span>
<span class="t s1" style="left:69px;bottom:287px;letter-spacing:-0.01px;">d'autonomie constatée, l'accompagnateur agréé oriente le ménage vers les acteurs compétents ; </span>
<span class="t s10" style="left:69px;bottom:259px;letter-spacing:-0.01px;">f) En cas de situation manifeste d'habitat indigne, d'indécence, de non-adaptation à une perte d'autonomie </span>
<span class="t s1" style="left:69px;bottom:232px;letter-spacing:-0.01px;">En cas de situation manifeste d'habitat indigne, d'indécence, de non-adaptation à une perte d'autonomie Identifiée à </span>
<span class="t s1" style="left:69px;bottom:214px;letter-spacing:-0.01px;">la suite des diagnostiques effectués, ou d'inadaptation des ressources et des conditions d'existence du ménage </span>
<span class="t s1" style="left:69px;bottom:196px;letter-spacing:-0.01px;">identifiée, l'accompagnateur agréé signalera les situations rencontrées à l'Agence nationale de l'habitat et aux </span>
<span class="t s1" style="left:69px;bottom:178px;letter-spacing:-0.01px;">guichets d'information, de conseil et d'accompagnement </span>
<span class="t s1" style="left:191px;bottom:75px;letter-spacing:-0.03px;word-spacing:0.01px;">VALOREM SASU au capital social 20 000,00 € - RCS BOBIGNY B 913 753 000 </span>
<span class="t s1" style="left:134px;bottom:56px;letter-spacing:-0.01px;">Code NAF ingénierie Études Techniques (7112B) - N° TVA intracommunautaire FR18913753000 </span>
<span class="t s11" style="left:254px;bottom:39px;letter-spacing:-0.13px;">N° d'Agréement Mon Accompagnateur Rènov' : MAR-93-0002122 </span></div>

